BEGIN TRANSACTION;;
CREATE TABLE category_prediction_items (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            prediction_id INTEGER, -- category_predictions 테이블의 id 참조
            product_code TEXT,
            product_name TEXT,
            recommended_quantity INTEGER,
            FOREIGN KEY (prediction_id) REFERENCES category_predictions (id)
        );;
CREATE TABLE category_predictions (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            prediction_date TEXT, -- 예측을 수행한 날짜
            target_date TEXT,     -- 예측 대상 날짜
            mid_code TEXT,        -- 중분류 코드
            mid_name TEXT,        -- 중분류명
            predicted_sales REAL, -- 예측된 판매량
            UNIQUE(target_date, mid_code)
        );;
CREATE TABLE prediction_performance (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            evaluation_date TEXT,   -- 성능 평가를 수행한 날짜 (오늘)
            target_date TEXT,       -- 평가 대상 날짜 (어제)
            mid_code TEXT,          -- 중분류 코드
            predicted_sales REAL,   -- 어제 예측했던 판매량
            actual_sales REAL,      -- 어제의 실제 판매량
            error_rate_percent REAL,-- 오차율 (%)
            UNIQUE(target_date, mid_code)
        );;
DELETE FROM "sqlite_sequence";;
COMMIT;;
